import { useEffect, useState } from "react";

import "../node_modules/bootstrap/dist/css/bootstrap.css";
import "./common.css";


import { Link, useNavigate, useParams } from "react-router-dom";

import { toast } from "react-toastify";
import { trackOrder as trackOrderApi } from "./services/orders";
import { log } from "./utils/utils";
import axios from "axios";

function Track() {

    const [trackorders, settrackorders] = useState([]);
    const navigate = useNavigate();


    useEffect(() => {
        trackOrder();
      }, []);
    const trackOrder = async () => {
     const response = await trackOrderApi(
           sessionStorage.getItem("trackingId"),
          );
          debugger;
          if (response!==null) {
            debugger;
            settrackorders(response);
            // go back to login
            //navigate("/customer");
          } else {
            toast.error("srrory some network issue");
          }
        }


  return (
  <>

    {trackorders.map((trackOrder) => {
        return (
    <div className="length">
      <center>
        <table className="table table-bordered">
          <tr>
            <center>
              <td  className="fa">fromAddres :</td>
              <td className="td">
              {trackOrder.fromAddress}
              </td>
            </center>
          </tr>
          <tr className="tr"></tr>
          <tr>
            <center>

              <td  className="fa">
                toAddress :<td className="td">
                    {trackOrder.toAddress}
                </td>
              </td>
            </center>
          </tr>
          <tr className="tr"></tr>
          <tr>
            <center>
              {" "}
              <td  className="fa">
                expectedDeliveryDate :<td className="td">
                    {trackOrder.expectedDeliveryDate}
                </td>
              </td>
            </center>
          </tr>
          <tr className="tr"></tr>
          <tr>
            <center className="fa">
              <td>
                 orderedDate :<td className="td">
                    {trackOrder.o}
                 </td>
              </td>
            </center>
          </tr>
          <tr className="tr"></tr>
        </table>
      </center>
    </div>
     );
    })}
  </>
  );
}
export default Track;
